import React, { useState, useEffect } from 'react';
import { View, Text, StyleSheet, FlatList, TouchableOpacity } from 'react-native';
import { useSelector, useDispatch } from 'react-redux';
import { setCards } from '../../store/slices/tarotSlice';
import { getCards } from '../../services/supabase/supabaseClient';
import TarotCard from '../../components/cards/TarotCard';
import Button from '../../components/common/Button';

const CardLibraryScreen = ({ navigation }) => {
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState('');
  const [filter, setFilter] = useState('all'); // 'all', 'major', 'minor', 'cups', 'wands', 'swords', 'pentacles'

  const dispatch = useDispatch();
  const cards = useSelector(state => state.tarot.cards);

  // Sample cards data for demo
  const sampleCards = [
    {
      id: '0',
      name: "The Fool",
      number: "0",
      arcana: "Major Arcana",
      suit: null,
      image: "m00.jpg",
      keywords: ["freedom", "faith", "inexperience", "innocence"],
      modern_interpretation: "This card represents freeing yourself from limitation, expressing joy, and being open-minded.",
      affirmation: "I embrace freedom and welcome its energy into my life."
    },
    {
      id: '1',
      name: "The Magician",
      number: "1",
      arcana: "Major Arcana",
      suit: null,
      image: "m01.jpg",
      keywords: ["power", "skill", "concentration", "action"],
      modern_interpretation: "This card represents tapping into your full potential, taking action, and manifesting your desires.",
      affirmation: "I have the power to create my reality."
    },
    {
      id: '2',
      name: "The High Priestess",
      number: "2",
      arcana: "Major Arcana",
      suit: null,
      image: "m02.jpg",
      keywords: ["intuition", "unconscious", "inner voice", "wisdom"],
      modern_interpretation: "This card represents connecting with your intuition, exploring the mysteries, and trusting your inner wisdom.",
      affirmation: "I trust my intuition and inner knowing."
    },
    {
      id: '3',
      name: "The Empress",
      number: "3",
      arcana: "Major Arcana",
      suit: null,
      image: "m03.jpg",
      keywords: ["fertility", "nurturing", "abundance", "sensuality"],
      modern_interpretation: "This card represents nurturing growth, embracing abundance, and connecting with nature.",
      affirmation: "I nurture my creative potential and embrace abundance."
    },
    {
      id: '4',
      name: "The Emperor",
      number: "4",
      arcana: "Major Arcana",
      suit: null,
      image: "m04.jpg",
      keywords: ["authority", "structure", "control", "leadership"],
      modern_interpretation: "This card represents establishing order, taking charge, and providing structure and stability.",
      affirmation: "I create structure and stability in my life."
    },
    {
      id: '21',
      name: "Ace of Cups",
      number: "1",
      arcana: "Minor Arcana",
      suit: "Cups",
      image: "c01.jpg",
      keywords: ["emotion", "intuition", "intimacy", "love"],
      modern_interpretation: "This card represents new emotional beginnings, creative inspiration, and the start of deep connections.",
      affirmation: "I am open to receiving love and emotional fulfillment."
    },
    {
      id: '22',
      name: "Two of Cups",
      number: "2",
      arcana: "Minor Arcana",
      suit: "Cups",
      image: "c02.jpg",
      keywords: ["partnership", "connection", "mutual attraction", "harmony"],
      modern_interpretation: "This card represents balanced partnerships, mutual respect, and harmonious relationships.",
      affirmation: "I create balanced and loving relationships in my life."
    },
    {
      id: '35',
      name: "Ace of Wands",
      number: "1",
      arcana: "Minor Arcana",
      suit: "Wands",
      image: "w01.jpg",
      keywords: ["creation", "willpower", "inspiration", "desire"],
      modern_interpretation: "This card represents new creative beginnings, inspiration, and the spark of passion.",
      affirmation: "I embrace new opportunities with enthusiasm and creativity."
    },
    {
      id: '49',
      name: "Ace of Swords",
      number: "1",
      arcana: "Minor Arcana",
      suit: "Swords",
      image: "s01.jpg",
      keywords: ["clarity", "truth", "breakthrough", "insight"],
      modern_interpretation: "This card represents mental clarity, breakthrough insights, and the power of truth.",
      affirmation: "I seek truth and clarity in all situations."
    },
    {
      id: '63',
      name: "Ace of Pentacles",
      number: "1",
      arcana: "Minor Arcana",
      suit: "Pentacles",
      image: "p01.jpg",
      keywords: ["opportunity", "prosperity", "abundance", "manifestation"],
      modern_interpretation: "This card represents new material opportunities, financial beginnings, and manifestation of resources.",
      affirmation: "I am open to receiving abundance and prosperity."
    }
  ];

  useEffect(() => {
    fetchCards();
  }, []);

  const fetchCards = async () => {
    setLoading(true);
    setError('');

    try {
      // In a real app, we would fetch from Supabase
      // const { data, error } = await getCards();

      // if (error) {
      //   throw error;
      // }

      // For demo purposes, use sample data
      dispatch(setCards(sampleCards));
      setTimeout(() => setLoading(false), 500); // Simulate loading
    } catch (err) {
      console.error('Error fetching cards:', err);
      setError('Failed to load cards. Please try again.');
      setLoading(false);
    }
  };

  const handleCardSelect = (card) => {
    navigation.navigate('CardDetail', { cardId: card.id });
  };

  const getFilteredCards = () => {
    if (filter === 'all') {
      return cards;
    } else if (filter === 'major') {
      return cards.filter(card => card.arcana === 'Major Arcana');
    } else if (filter === 'minor') {
      return cards.filter(card => card.arcana === 'Minor Arcana');
    } else if (['cups', 'wands', 'swords', 'pentacles'].includes(filter)) {
      return cards.filter(card => card.suit?.toLowerCase() === filter);
    }
    return cards;
  };

  const renderCardItem = ({ item }) => (
    <TouchableOpacity
      style={styles.cardItem}
      onPress={() => handleCardSelect(item)}
    >
      <TarotCard
        card={item}
        style={styles.card}
      />
      <Text style={styles.cardName}>{item.name}</Text>
    </TouchableOpacity>
  );

  return (
    <View style={styles.container}>
      <Text style={styles.title}>Card Library</Text>

      <View style={styles.filterContainer}>
        <ScrollView horizontal showsHorizontalScrollIndicator={false}>
          <TouchableOpacity
            style={[styles.filterButton, filter === 'all' && styles.filterButtonActive]}
            onPress={() => setFilter('all')}
          >
            <Text style={[styles.filterText, filter === 'all' && styles.filterTextActive]}>All</Text>
          </TouchableOpacity>

          <TouchableOpacity
            style={[styles.filterButton, filter === 'major' && styles.filterButtonActive]}
            onPress={() => setFilter('major')}
          >
            <Text style={[styles.filterText, filter === 'major' && styles.filterTextActive]}>Major Arcana</Text>
          </TouchableOpacity>

          <TouchableOpacity
            style={[styles.filterButton, filter === 'minor' && styles.filterButtonActive]}
            onPress={() => setFilter('minor')}
          >
            <Text style={[styles.filterText, filter === 'minor' && styles.filterTextActive]}>Minor Arcana</Text>
          </TouchableOpacity>

          <TouchableOpacity
            style={[styles.filterButton, filter === 'cups' && styles.filterButtonActive]}
            onPress={() => setFilter('cups')}
          >
            <Text style={[styles.filterText, filter === 'cups' && styles.filterTextActive]}>Cups</Text>
          </TouchableOpacity>

          <TouchableOpacity
            style={[styles.filterButton, filter === 'wands' && styles.filterButtonActive]}
            onPress={() => setFilter('wands')}
          >
            <Text style={[styles.filterText, filter === 'wands' && styles.filterTextActive]}>Wands</Text>
          </TouchableOpacity>

          <TouchableOpacity
            style={[styles.filterButton, filter === 'swords' && styles.filterButtonActive]}
            onPress={() => setFilter('swords')}
          >
            <Text style={[styles.filterText, filter === 'swords' && styles.filterTextActive]}>Swords</Text>
          </TouchableOpacity>

          <TouchableOpacity
            style={[styles.filterButton, filter === 'pentacles' && styles.filterButtonActive]}
            onPress={() => setFilter('pentacles')}
          >
            <Text style={[styles.filterText, filter === 'pentacles' && styles.filterTextActive]}>Pentacles</Text>
          </TouchableOpacity>
        </ScrollView>
      </View>

      {loading ? (
        <View style={styles.loadingContainer}>
          <Text style={styles.loadingText}>Loading cards...</Text>
        </View>
      ) : error ? (
        <View style={styles.errorContainer}>
          <Text style={styles.errorText}>{error}</Text>
          <Button title="Try Again" onPress={fetchCards} type="secondary" />
        </View>
      ) : (
        <FlatList
          data={getFilteredCards()}
          renderItem={renderCardItem}
          keyExtractor={item => item.id}
          numColumns={2}
          contentContainerStyle={styles.cardsList}
          showsVerticalScrollIndicator={false}
          ListEmptyComponent={
            <View style={styles.emptyContainer}>
              <Text style={styles.emptyText}>No cards found</Text>
            </View>
          }
        />
      )}
    </View>
  );
};

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#FAF3E0',
    padding: 20,
  },
  title: {
    fontSize: 28,
    fontWeight: 'bold',
    color: '#9B59B6',
    marginTop: 40,
    marginBottom: 20,
  },
  filterContainer: {
    marginBottom: 20,
  },
  filterButton: {
    paddingVertical: 8,
    paddingHorizontal: 16,
    borderRadius: 20,
    marginRight: 10,
    backgroundColor: '#F0E6D2',
  },
  filterButtonActive: {
    backgroundColor: '#9B59B6',
  },
  filterText: {
    fontSize: 14,
    fontWeight: '500',
    color: '#9B59B6',
  },
  filterTextActive: {
    color: '#FFFFFF',
  },
  cardsList: {
    paddingBottom: 20,
  },
  cardItem: {
    width: '48%',
    marginHorizontal: '1%',
    marginBottom: 20,
    alignItems: 'center',
  },
  card: {
    width: '100%',
    aspectRatio: 0.6,
    marginBottom: 10,
  },
  cardName: {
    fontSize: 14,
    fontWeight: '500',
    color: '#4A4A4A',
    textAlign: 'center',
  },
  loadingContainer: {
    flex: 1,
    justifyContent: 'center',
    alignItems: 'center',
  },
  loadingText: {
    fontSize: 16,
    color: '#9B59B6',
    fontStyle: 'italic',
  },
  errorContainer: {
    flex: 1,
    justifyContent: 'center',
    alignItems: 'center',
    padding: 20,
  },
  errorText: {
    fontSize: 16,
    color: '#E74C3C',
    textAlign: 'center',
    marginBottom: 20,
  },
  emptyContainer: {
    padding: 20,
    alignItems: 'center',
  },
  emptyText: {
    fontSize: 16,
    color: '#8E8E93',
    fontStyle: 'italic',
  },
});

export default CardLibraryScreen;
